import { useState } from 'react';
import './App.css';
import Drink from './Drink';
import Eat from './Eat';
import Home from './Home';

function App() {
  const [page, setPage] = useState('home')

  const showPage = () => {
    if(page === 'home') return <Home/>
    if(page === 'eat') return <Eat/>
    if(page === 'drink') return <Drink/>
  }

  return (
    <div className="App">
      {showPage()}
    </div>
  );
}

export default App;
